import React from 'react';

const InferText = ({check}) => {
    console.log({check});
    if ({check} === "true") {
        return (
            <div className = "center">
                <h2> "This food is okay to eat!" </h2>

            </div>
        );
    }
    else if ({check} === "false"){
        return (
            <div className = "center">
                <h2> "This food is NOT okay to eat!" </h2>

            </div>
        );


    }
    return null;


}

export default InferText;
